in_source: |
  {
      string str = input();
      while(str != "$"){
          print(str);
          str = input();
      }
  }
in_stdin: |
  cat.cat.cat.$.
out_ast: |
  Program:
    Assign(var=str, var_type=STRING_TYPE)
      FunctionCall(input)
    While:
      Condition:
        BinaryOp(
            Identifier(str)
          NEQ
            String("$")
        )
      WhileBody:
        Print:
          Identifier(str)
        Assign(var=str, var_type=unknown)
          FunctionCall(input)
